const useStyles = makeStyles((theme) => ({}));
export default function Header() {
    return (
    <div>
        <AppBar>
            <h1>ShopInn</h1>
            <IconButton>
                <SortIcon />
            </IconButton>
        </AppBar>
    </div>
    )
}
